import React from 'react'
import style from './style'
import Component from './component'
import Monitor from './monitor'

let View = props => {
	let {state, event, onUpdate} = props

	console.log(state.system.data)

	return <div style={style}>
			<Monitor
				Component={Component}
				state={state}
				style={style.monitor}
				event={event}
			 />
		</div>
}

export default View
